/*******************************************************************************
   Create Tables
********************************************************************************/
DROP TABLE IF EXISTS Artist CASCADE;
CREATE TABLE Artist
(
    ArtistId INT NOT NULL,
    Name VARCHAR(120),
    CONSTRAINT PK_Artist PRIMARY KEY (ArtistId)
);

DROP TABLE IF EXISTS Album CASCADE;
CREATE TABLE Album
(
    AlbumId INT NOT NULL,
    Title VARCHAR(160) NOT NULL,
    ArtistId INT NOT NULL,
    CONSTRAINT PK_Album PRIMARY KEY (AlbumId),
    FOREIGN KEY (ArtistId) REFERENCES Artist (ArtistId) ON DELETE NO ACTION ON UPDATE NO ACTION
);

DROP TABLE IF EXISTS Employee CASCADE;
CREATE TABLE Employee
(
    EmployeeId INT NOT NULL,
    LastName VARCHAR(20) NOT NULL,
    FirstName VARCHAR(20) NOT NULL,
    Title VARCHAR(30),
    ReportsTo INT,
    BirthDate TIMESTAMP,
    HireDate TIMESTAMP,
    Address VARCHAR(70),
    City VARCHAR(40),
    State VARCHAR(40),
    Country VARCHAR(40),
    PostalCode VARCHAR(10),
    Phone VARCHAR(24),
    Fax VARCHAR(24),
    Email VARCHAR(60),
    CONSTRAINT PK_Employee PRIMARY KEY (EmployeeId),
    FOREIGN KEY (ReportsTo) REFERENCES Employee (EmployeeId) ON DELETE NO ACTION ON UPDATE NO ACTION
);

DROP TABLE IF EXISTS Customer CASCADE;
CREATE TABLE Customer
(
    CustomerId INT NOT NULL,
    FirstName VARCHAR(40) NOT NULL,
    LastName VARCHAR(20) NOT NULL,
    Company VARCHAR(80),
    Address VARCHAR(70),
    City VARCHAR(40),
    State VARCHAR(40),
    Country VARCHAR(40),
    PostalCode VARCHAR(10),
    Phone VARCHAR(24),
    Fax VARCHAR(24),
    Email VARCHAR(60) NOT NULL,
    SupportRepId INT,
    CONSTRAINT PK_Customer PRIMARY KEY (CustomerId),
    FOREIGN KEY (SupportRepId) REFERENCES Employee (EmployeeId) ON DELETE NO ACTION ON UPDATE NO ACTION
);

DROP TABLE IF EXISTS Genre CASCADE;
CREATE TABLE Genre
(
    GenreId INT NOT NULL,
    Name VARCHAR(120),
    CONSTRAINT PK_Genre PRIMARY KEY (GenreId)
);

DROP TABLE IF EXISTS Invoice CASCADE;
CREATE TABLE Invoice
(
    InvoiceId INT NOT NULL,
    CustomerId INT NOT NULL,
    InvoiceDate TIMESTAMP NOT NULL,
    BillingAddress VARCHAR(70),
    BillingCity VARCHAR(40),
    BillingState VARCHAR(40),
    BillingCountry VARCHAR(40),
    BillingPostalCode VARCHAR(10),
    Total NUMERIC(10,2) NOT NULL,
    CONSTRAINT PK_Invoice PRIMARY KEY (InvoiceId),
    FOREIGN KEY (CustomerId) REFERENCES Customer (CustomerId) ON DELETE NO ACTION ON UPDATE NO ACTION
);

DROP TABLE IF EXISTS MediaType CASCADE;
CREATE TABLE MediaType
(
    MediaTypeId INT NOT NULL,
    Name VARCHAR(120),
    CONSTRAINT PK_MediaType PRIMARY KEY (MediaTypeId)
);

DROP TABLE IF EXISTS Track CASCADE;
CREATE TABLE Track
(
    TrackId INT NOT NULL,
    Name VARCHAR(200) NOT NULL,
    AlbumId INT,
    MediaTypeId INT NOT NULL,
    GenreId INT,
    Composer VARCHAR(220),
    Milliseconds INT NOT NULL,
    Bytes INT,
    UnitPrice NUMERIC(10,2) NOT NULL,
    CONSTRAINT PK_Track PRIMARY KEY (TrackId),
    FOREIGN KEY (AlbumId) REFERENCES Album (AlbumId) ON DELETE NO ACTION ON UPDATE NO ACTION,
    FOREIGN KEY (GenreId) REFERENCES Genre (GenreId) ON DELETE NO ACTION ON UPDATE NO ACTION,
    FOREIGN KEY (MediaTypeId) REFERENCES MediaType (MediaTypeId) ON DELETE NO ACTION ON UPDATE NO ACTION
);

DROP TABLE IF EXISTS InvoiceLine CASCADE;
CREATE TABLE InvoiceLine
(
    InvoiceLineId INT NOT NULL,
    InvoiceId INT NOT NULL,
    TrackId INT NOT NULL,
    UnitPrice NUMERIC(10,2) NOT NULL,
    Quantity INT NOT NULL,
    CONSTRAINT PK_InvoiceLine PRIMARY KEY (InvoiceLineId),
    FOREIGN KEY (InvoiceId) REFERENCES Invoice (InvoiceId) ON DELETE NO ACTION ON UPDATE NO ACTION,
    FOREIGN KEY (TrackId) REFERENCES Track (TrackId) ON DELETE NO ACTION ON UPDATE NO ACTION
);

DROP TABLE IF EXISTS Playlist CASCADE;
CREATE TABLE Playlist
(
    PlaylistId INT NOT NULL,
    Name VARCHAR(120),
    CONSTRAINT PK_Playlist PRIMARY KEY (PlaylistId)
);

DROP TABLE IF EXISTS PlaylistTrack CASCADE;
CREATE TABLE PlaylistTrack
(
    PlaylistId INT NOT NULL,
    TrackId INT NOT NULL,
    CONSTRAINT PK_PlaylistTrack PRIMARY KEY (PlaylistId, TrackId),
    FOREIGN KEY (PlaylistId) REFERENCES Playlist (PlaylistId) ON DELETE NO ACTION ON UPDATE NO ACTION,
    FOREIGN KEY (TrackId) REFERENCES Track (TrackId) ON DELETE NO ACTION ON UPDATE NO ACTION
);



/*******************************************************************************
   Create Primary Key Unique Indexes
********************************************************************************/
DROP INDEX IF EXISTS IFK_AlbumArtistId;
CREATE INDEX IFK_AlbumArtistId ON Album (ArtistId);
DROP INDEX IF EXISTS IFK_CustomerSupportRepId;
CREATE INDEX IFK_CustomerSupportRepId ON Customer (SupportRepId);
DROP INDEX IF EXISTS IFK_EmployeeReportsTo;
CREATE INDEX IFK_EmployeeReportsTo ON Employee (ReportsTo);
DROP INDEX IF EXISTS IFK_InvoiceCustomerId;
CREATE INDEX IFK_InvoiceCustomerId ON Invoice (CustomerId);
DROP INDEX IF EXISTS IFK_InvoiceLineInvoiceId;
CREATE INDEX IFK_InvoiceLineInvoiceId ON InvoiceLine (InvoiceId);
DROP INDEX IF EXISTS IFK_InvoiceLineTrackId;
CREATE INDEX IFK_InvoiceLineTrackId ON InvoiceLine (TrackId);
DROP INDEX IF EXISTS IFK_PlaylistTrackTrackId;
CREATE INDEX IFK_PlaylistTrackTrackId ON PlaylistTrack (TrackId);
DROP INDEX IF EXISTS IFK_TrackAlbumId;
CREATE INDEX IFK_TrackAlbumId ON Track (AlbumId);
DROP INDEX IF EXISTS IFK_TrackGenreId;
CREATE INDEX IFK_TrackGenreId ON Track (GenreId);
DROP INDEX IF EXISTS IFK_TrackMediaTypeId;
CREATE INDEX IFK_TrackMediaTypeId ON Track (MediaTypeId);

/*******************************************************************************
   Populate Tables
********************************************************************************/











DROP TABLE IF EXISTS permisos_usuario CASCADE;
CREATE TABLE permisos_usuario (
        		permisoid INT PRIMARY KEY,
        		contrasea VARCHAR(30) NOT NULL,
        		customerid INT NOT NULL,
        		puede_registrar bool not null,
        		puede_inactivar bool not null,
        		puede_eliminar bool not null,
        		puede_modificar bool not null,
        		
        		FOREIGN KEY (customerid) REFERENCES customer(customerid)
        	);
        
DROP TABLE IF EXISTS permisos_admin CASCADE;
CREATE TABLE permisos_admin (
        		permisoid INT PRIMARY KEY,
        		contrasea VARCHAR(30) NOT NULL,
        		employeeid INT NOT NULL,
        		FOREIGN KEY (employeeid) REFERENCES employee(employeeid)
        	);
        
DROP TABLE IF EXISTS actividad_track CASCADE;
CREATE TABLE actividad_track (
        		actividadid INT PRIMARY KEY,
        		esta_activo bool not null,
        		trackid INT NOT NULL,
        		FOREIGN KEY (trackid) REFERENCES track(trackid)
        	);


DROP TABLE IF EXISTS creador_track CASCADE;
CREATE TABLE creador_track (
				relacionid INT PRIMARY KEY,
        		creadorid INT ,
        		trackid INT NOT NULL,
        		FOREIGN KEY (trackid) REFERENCES track(trackid),
        		FOREIGN KEY (creadorid) REFERENCES customer(customerid)
        	);
        
        
 
